import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Rapidly manipulate the cart
    for (let i = 1; i <= 5; i++) {
      // Click on the "Add to Cart" button for the first product
      await page.waitForSelector('.add-to-cart');
      await page.click('.add-to-cart');

      // Wait for the cart counter to update
      await page.waitForSelector('.cart-count');
      const cartCount = await page.$eval('.cart-count', el => el.textContent);
      console.log(`Cart count after adding product ${i}: ${cartCount}`);

      // Take a screenshot after each addition
      await page.screenshot({ path: path.join(screenshotsDir, `step_2_add_to_cart_${i}.png`) });
      screenshots.push(path.join(screenshotsDir, `step_2_add_to_cart_${i}.png`));
    }

    // Proceed to checkout
    await page.waitForSelector('.checkout-btn');
    await page.click('.checkout-btn');

    // Wait for the checkout page to load
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_checkout_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_checkout_page.png'));

    return {
      success: true,
      action: "Successfully manipulated the cart and proceeded to checkout",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
